use std::collections::HashMap;
use std::sync::LazyLock;

/// Lookup map: US -> GB spelling
pub static EN_US_TO_GB: LazyLock<HashMap<String, &'static str>> = LazyLock::new(|| {
	let mut map = HashMap::new();
	for m in EN_US_GB_MAPPINGS {
		map.insert(m.us_word.to_lowercase(), m.gb_word);
	}
	map
});

/// Lookup map: GB -> US spelling
pub static EN_GB_TO_US: LazyLock<HashMap<String, &'static str>> = LazyLock::new(|| {
	let mut map = HashMap::new();
	for m in EN_US_GB_MAPPINGS {
		map.insert(m.gb_word.to_lowercase(), m.us_word);
	}
	map
});

/// Convert US spelling to GB spelling
pub fn us_to_gb(word: &str) -> Option<&'static str> {
	EN_US_TO_GB.get(&word.to_lowercase()).copied()
}

/// Convert GB spelling to US spelling
pub fn gb_to_us(word: &str) -> Option<&'static str> {
	EN_GB_TO_US.get(&word.to_lowercase()).copied()
}

/// Check if a word is a US spelling variant
pub fn is_us_spelling(word: &str) -> bool {
	EN_US_TO_GB.contains_key(&word.to_lowercase())
}

/// Check if a word is a GB spelling variant
pub fn is_gb_spelling(word: &str) -> bool {
	EN_GB_TO_US.contains_key(&word.to_lowercase())
}
